import React, { useState } from 'react';
import './style/Login.css';
import Nav from './Nav';

function Newuser() {
  const [userData, setUserData] = useState({
    username: '',
    password: '',
    profession: '',
    firstName: '',
    lastName: '',
    phone: '',
    email: '',
  });

  const [error, setError] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setUserData({ ...userData, [name]: value });
    setError(null);
  };

  const validateForm = () => {
    // Basic validation checks
    if (
      !userData.username ||
      !userData.password ||
      !userData.profession ||
      !userData.firstName ||
      !userData.lastName ||
      !userData.phone ||
      !userData.email
    ) {
      setError('Lūdzu aizpildi visus laukus.');
      return false;
    }

    // Phone number validation (numeric)
    const phoneRegex = /^[0-9]+$/;
    if (!phoneRegex.test(userData.phone)) {
      setError('Lūdzu ievadi derīgu telefona numuru.');
      return false;
    }
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  if (!emailRegex.test(userData.email)) {
    setError('Lūdzu ievadi derīgu epasta adresi.');
    return false;
  }
  if (userData.profession === '') {
    setError('Lūdzu izvēlies profesiju.');
    return false;
  }

    // You can add more specific validations for other fields if needed

    return true;
  };

  const handleAddUser = () => {
    if (!validateForm()) {
      return;
    }

    fetch('http://localhost:8888/api/insertions.php', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(userData),
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.success) {
          setUserData({
            username: '',
            password: '',
            profession: '',
            firstName: '',
            lastName: '',
            phone: '',
            email: '',
          });
          setError(null);
          console.log('User added successfully');
        } else {
          setError(data.message);
          console.error('Error adding user:', data.message);
        }
      })
      .catch((error) => {
        setError('An error occurred. Please try again later.');
        console.error('Error:', error);
      });
  };

  return (

      <div className="galvana-kaste">

      <div className="otra-kaste">
        <label className='new-user-label'>Lietotajvārds</label>
        <input
          className='new-user-input'
          name='username'
          value={userData.username}
          onChange={handleInputChange}
        />
        </div>
        <div className="otra-kaste">
        <label className='new-user-label'>Parole</label>
        <input
          className='new-user-input'
          name='password'
          type='password'
          value={userData.password}
          onChange={handleInputChange}
        />
        </div>
        <div className='otra-kaste'>
        <label className='new-user-label'>Profesija</label>

          <select
            className='new-user-input'
            name='profession'
            value={userData.profession}
            onChange={handleInputChange}
          >
            <option value="">Select Profession</option>
            <option value="1">Admin</option>
            <option value="2">Noliktavas Darbinieks</option>
            <option value="3">Plauktu kartotajs</option>
          </select>
          </div>
        <div className="otra-kaste">
        <label className='new-user-label'>Vārds</label>
        <input
          className='new-user-input'
          name='firstName'
          value={userData.firstName}
          onChange={handleInputChange}
        />
        </div>

        <div className="otra-kaste">
        <label className='new-user-label'>Uzvārds</label>
        <input
          className='new-user-input'
          name='lastName'
          value={userData.lastName}
          onChange={handleInputChange}
        />
        </div>
        <div className="otra-kaste">
        <label className='new-user-label'>Telefona numurs</label>
        <input
          className='new-user-input'
          name='phone'
          value={userData.phone}
          onChange={handleInputChange}
          maxLength={12} // Set the maximum length to 12 characters
        />
        </div>
        <div className="otra-kaste">
        <label className='new-user-label'>Epasts</label>
        <input
          className='new-user-input'
          name='email'
          type='email'
          value={userData.email}
          onChange={handleInputChange}
        />
        {error && (
          <div className="error-message">
            {error}
          </div>
        )}
        </div>
        <div className='new-user-button'>
          <button className='new-user-button-style' onClick={handleAddUser}>
            Pievienot
          </button>
        </div>
      </div>
  );
}

export default Newuser;
